            <button  ><span className="spimg">  <img style={{width:"8vw"}} src={Imgv} alt="" />   विडियो में देखें कैसे </span></button>

                </div> 
                 <div className="vidp">
                <video width="80%" height="100%" controls autoPlay loop muted >
                <source src="https://www.youtube.com/watch?v=ZaWQql80sg8" />
                </video>
                </div>  
                {/* <h1>hello</h1> */}
            </div>
            {/* <div>
                <div>
                <span>hehjkedwjhbcjhqbhch</span>
                    <span>kjne2kfje</span>
                    <button>jnn2fllefn</button>
                </div>
                <video src="https://www.youtube.com/watch?v=ZaWQql80sg8"></video>
            </div> */}
            {/* <div>
                <div>
                <span>hehjkedwjhbcjhqbhch</span>
                    <span>kjne2kfje</span>
                    <button>jnn2fllefn</button>
                </div>
                <video src="https://www.youtube.com/watch?v=ZaWQql80sg8"></video>
            </div> */}
        </div>

  );
};

export default VideoCarousel;
